import { createRouter, createWebHistory } from 'vue-router';
import PaginaUno from '../views/PaginaUno.vue';
import PaginaDos from '../views/PaginaDos.vue';
import PaginaTres from '../views/PaginaTres.vue';
import IniciarAdmin from '../views/IniciarAdmin.vue';
import TransaccionarUser from '../views/TransaccionarUser.vue';

const routes = [
  {
    path: '/',
    name: 'Pagina1',
    component: PaginaUno
  },
  {
    path: '/pagina2',
    name: 'Pagina2',
    component: PaginaDos
  },
  {
    path: '/pagina2/pagina3/:username',
    name: 'pagina3',
    component: PaginaTres
  },
  {
    path: '/iniciaradmin', // Ruta para la p치gina "Iniciar Admin"
    name: 'IniciarAdmin', // Nombre de la ruta
    component: IniciarAdmin, // Componente de la p치gina "Iniciar Admin"
  },
  {
    path: '/transaccionaruser',
    name: 'TransaccionarUser',
    component: TransaccionarUser,
  }
];


const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
